import ReactDOM from 'react-dom';
import data from './data';

function Cake(props) {

  if(props.data) {

  return (

    <div className="card" style={{width: '28rem',marginLeft:'10px',height:'30em'}}>

  <img src={props.data.image} className="card-img-top" alt={props.data.image} style={{height: '18rem'}} />
  <div className="card-body">
    <h5 className="card-title">{props.data.name}</h5>
    <p className="card-text"> Rs.{props.data.price}</p>
    <a href="javascript.void(0);" className="btn btn-primary">Add To Cart</a>
  </div>
</div>


  );
}
else { 
  return null
}
}

export default Cake;
